import React from 'react'

const crumbs = {
    backgroundColor: 'teal',
    border: '1px solid red',
    borderRadius: '5', color
}

function Crumbs(props) {

    function isLast(index) {
        return index === props.crumbs.length - 1;
}

  return (
      <nav className='row justify-content-center mt-4'>
          <ol className='crumbs' style={crumbs}>
              {props.crumbs.map((crumb,ci) => {
                  const disabled = isLast(ci) ? 'disabled' : '';
                  return (
                      <li key={ci}
                      className='crumb-item align-items-center'
                      >
                          <button className={`btn btn-link ${disabled}`} onClick={() => props.selected(crumb)}>
                          {crumb}
                          </button> 
                      </li>
                  );
              })}
          </ol>    
    </nav>
  )
}

export default Crumbs
